        of Air and Water Resource and Solid Waste Management Programs"},{"Name":"Abstract","Label":"Abstract","Group":"Ab","Data":"The
        climate change vulnerability discourse in the Maldives coexists with a pervasive
        set of critical environmental factors of significance to the socio-environmental
        systems of small peripheral islands. This implies the need to strike a balance
        between global challenges associated with environmental processes at the supra-national
        scale and the adjustments and strategies implemented at the local scale in
        response to change. The current paper offers a discussion of this dialectic,
        in reference to both the broader contemporary debate in island studies, and
        the political and environmental context of the Maldives. We first outline
        the international scenario, and then go on, in the second part of the paper,
        to provide a reading of environmental policy on these islands. We argue that
        emphasizing the country&#39;s environmental vulnerability has reinforced a
